/**
 * Constants
 * */
export const moduleName = "mainTable";
const prefix = `${appName}/${moduleName}`;
export const LOAD_ALL_EQUIPMENT = `${prefix}/LOAD_ALL_EQUIPMENT`;
export const LOAD_ALL_EQUIPMENT_START = `${prefix}/LOAD_ALL_EQUIPMENT_START`;
export const LOAD_ALL_EQUIPMENT_SUCCESS = `${prefix}/LOAD_ALL_EQUIPMENT_SUCCESS`;
export const DELETE_EQUIPMENT = `${prefix}/DELETE_EQUIPMENT`;
export const SELECT_EQUIPMENT = `${prefix}/SELECT_EQUIPMENT`;
export const SELECT_ALL_EQUIPMENT = `${prefix}/SELECT_ALL_EQUIPMENT`;
export const ORDER_BY = `${prefix}/ORDER_BY`;
export const SHOW_EQUIPMENT = `${prefix}/SHOW_EQUIPMENT`;
export const EDIT_EQUIPMENT = `${prefix}/EDIT_EQUIPMENT`;

/**
 * Reducer
 * */
let DefaulrReducerState = new Record({
  isLoading: false,
  collection: new List([]),
  selected: new Map({}),
  orderData: new Map({
    order: "asc",
    orderBy: "model"
  })
});

const EquipmentModel = Record({
  id: null,
  model: null,
  serial: null,
  type: null,
  front: null,
  completeness: null,
  cost: null,
  location: null,
  date: null,
  additionalInformation: null
});

const defaultState = new DefaulrReducerState();

export default function reducer(state = defaultState, action) {
  const { type, payload, collection } = action;
  const { selected } = state;

  switch (type) {
    case LOAD_ALL_EQUIPMENT_START:
      return state.set("isLoading", true);

    case LOAD_ALL_EQUIPMENT_SUCCESS:
      return state.set("isLoading", false).set("collection", collection);

    case SELECT_EQUIPMENT:
      const { item } = payload;

      if (selected.has(item.id)) {
        return state.setIn(["selected"], selected.delete(item.id));
      }

      return state.setIn(["selected"], selected.set(item.id, item));

    case SELECT_ALL_EQUIPMENT:
      if (state.collection.length === state.selected.size)
        return state.setIn(["selected"], new Map({}));
      let result = {};

      state.collection.forEach(item => {
        result[item.id] = item;
      });
      return state.setIn(["selected"], new Map(result));

    case DELETE_EQUIPMENT:
      let newCollection = state.collection.filter(item => {
        return !state.selected.includes(item);
      });

      return state
        .setIn(["collection"], newCollection)
        .setIn(["selected"], new Map({}));

    case SHOW_EQUIPMENT:
    case EDIT_EQUIPMENT:
      history.push("/RetailEquipmentPageView");

      return state;

    case ORDER_BY:
      const { property } = payload;

      let order = "desc";

      if (
        state.getIn(["orderData", "orderBy"]) === property &&
        state.getIn(["orderData", "order"]) === "desc"
      ) {
        order = "asc";
      }

      const newstate = state
        .setIn(["orderData", "order"], order)
        .setIn(["orderData", "orderBy"], property);

      // TODO: Переделать организацию хранения данных в сторэдж
      localStorage.setItem(
        "orderData",
        JSON.stringify(newstate.get("orderData").toJS())
      );
      return newstate;
